        result.x22 = (-0.4e1 * a * a * k * pow(r, 0.3e1) + 0.2e1 * a * a * mu * pow(r, 0.3e1) + 0.6e1 * pow(a, 0.3e1) * mu * r * r - 0.2e1 * pow(a, 0.3e1) * la + 0.2e1 * pow(a, 0.5e1) * mu + la * pow(r, 0.3e1) + 0.6e1 * pow(a, 0.4e1) * mu * r - mu * y * r * r + 0.3e1 * mu * r * r * a - 0.2e1 * mu * y * r * a + 0.2e1 * la * log(a * (a + r)) * pow(a, 0.3e1) - pow(r, 0.3e1) * la * log(a * (a + r)) + 0.2e1 * x * la * r * a - 0.4e1 * k * pow(a, 0.5e1) + 0.3e1 * a * la * r * r - 0.12e2 * k * pow(a, 0.4e1) * r - 0.12e2 * k * pow(a, 0.3e1) * r * r - 0.3e1 * a * la * log(a * (a + r)) * r * r + 0.2e1 * y * la * log(a * (a + r)) * r * a - y * la * r * r + 0.4e1 * k * y * pow(a, 0.4e1) - 0.2e1 * y * la * r * a + 0.8e1 * k * y * pow(a, 0.3e1) * r + 0.4e1 * k * y * a * a * r * r + y * la * log(a * (a + r)) * r * r + 0.2e1 * la * a * a * x + mu * pow(r, 0.3e1) - 0.2e1 * mu * pow(a, 0.3e1)) * pow(a, -0.2e1) * pow(a + r, -0.2e1) / 0.2e1;
